        <script>
            function updateGraphs() {
                var selectedPlayer = document.getElementById("playerSelect").value;
                var deathThreshold = document.getElementById("deathThreshold").value;
                var graphs = ['graph_dps', 'graph_hps', 'graph_ilvl', 'graph_parse', 'graph_deaths'];
                
                graphs.forEach(function(gid) {
                    var gd = document.getElementById(gid);
                    if (!gd || !gd.data) return;

                    // 1. Initialize backup of templates ONCE per graph.
                    // This ensures we always have the clean original string, 
                    // regardless of how many times we run the filter.
                    if (!gd.backupTemplates) {
                        gd.backupTemplates = [];
                        for (var t = 0; t < gd.data.length; t++) {
                            gd.backupTemplates[t] = gd.data[t].hovertemplate;
                        }
                    }

                    for(var i=0; i < gd.data.length; i++) {
                        var trace = gd.data[i];

                        // ILVL Graph uses standard visibility toggle, no fancy point hiding needed
                        if (gid === 'graph_ilvl') {
                            var isVisible = (selectedPlayer === 'ALL' || trace.name === selectedPlayer);
                            Plotly.restyle(gid, {'visible': isVisible}, [i]);
                            continue;
                        }

                        if (!trace.customdata) continue;

                        // Retrieve the clean template from our backup
                        var sourceTemplate = gd.backupTemplates[i];

                        var newOpacity = [];
                        var newSize = [];
                        var newHoverInfo = [];
                        var newHoverTemplate = [];
                        
                        for(var j=0; j < trace.customdata.length; j++) {
                            var pName = trace.customdata[j][0];
                            var keep = true;

                            // Player Filter
                            if (selectedPlayer !== 'ALL' && pName !== selectedPlayer) keep = false;

                            // Death Threshold Filter
                            if (gid === 'graph_deaths' && keep) {
                                var raidRank = trace.customdata[j][3];
                                if (raidRank > parseInt(deathThreshold)) keep = false;
                            }

                            if (keep) {
                                newOpacity.push(1);
                                newSize.push(gid === 'graph_parse' ? 14 : 10);
                                newHoverInfo.push('all');
                                newHoverTemplate.push(sourceTemplate); // Use original
                            } else {
                                newOpacity.push(0);
                                newSize.push(0);
                                newHoverInfo.push('skip'); // Disable interaction
                                newHoverTemplate.push(null); // Must be null for 'skip' to take precedence
                            }
                        }
                        
                        Plotly.restyle(gid, {
                            'marker.opacity': [newOpacity], 
                            'marker.size': [newSize], 
                            'hoverinfo': [newHoverInfo],
                            'hovertemplate': [newHoverTemplate]
                        }, [i]);
                    }
                });
            }
        </script>
